    "plt.title('temperature of the days')\n",
    "plt.axis([0,6,0,60])\n",
    "plt.xlabel('days')\n",
    "plt.ylabel('temperature')\n",
    "style.use('ggplot')\n",
    "plt.grid(color='r')\n",
    "plt.legend()\n",
    "plt.show()"
